defs.script:
var showId = 28410470;
var hideprice = 0;
var pg = new Array;
var price = new Array;
var lvl = new Array;
var side = new Array;
var vvg = new Array;
var charge = new Array;
var refund = new Array;
var pgcol = new Array;

pg[0]="PK 1"; price[0]="131,25"; vvg[0]="0,00"; charge[0]="9,07"; refund[0]="0,00"; pgcol[0]="#FFFF00";
pg[1]="PK 2"; price[1]="111,54"; vvg[1]="0,00"; charge[1]="8,49"; refund[1]="0,00"; pgcol[1]="#FF0000";
pg[2]="PK 3"; price[2]="93,62"; vvg[2]="0,00"; charge[2]="7,97"; refund[2]="0,00"; pgcol[2]="#003CFF";
pg[3]="PK 4"; price[3]="75,71"; vvg[3]="0,00"; charge[3]="7,45"; refund[3]="0,00"; pgcol[3]="#C85000";
pg[4]="PK 5"; price[4]="147,36"; vvg[4]="0,00"; charge[4]="9,53"; refund[4]="0,00"; pgcol[4]="#00783C";
pg[5]="PK 6"; price[5]="153,64"; vvg[5]="0,00"; charge[5]="9,72"; refund[5]="0,00"; pgcol[5]="#7FFFFF";
lvl[0] = "Rang";
lvl[1] = "Parkett";
lvl[2] = "ausbau";
lvl[3] = "zusatz";
side[0] = "links";
side[1] = "rechts";

svg.script:
var blockno = 0;

var pgseats = document.querySelectorAll('[class^=pg]');

Array
  .from(pgseats)
  .forEach(element => element.addEventListener('mouseover', function(e) {

     var thisElement = e.currentTarget;
     var curdata = thisElement.getAttribute('orestes:data');
     var datas = curdata.split(',');
     thisElement.classList.add('cur');

     var txt="Ebene="+lvl[datas[0]]+" | Seite="+side[datas[1]];
     posx=thisElement.attributes.cx;
     posy=thisElement.attributes.cy;

     var ttt= document.getElementById("ttt");
	 ttt.innerHTML = txt;

     txt="Reihe "+datas[2]+" Sitz "+datas[3];
	 var ttu= document.getElementById("ttu");
	 ttu.innerHTML = txt;

     if ((typeof hideprice === 'undefined') || (hideprice == "0")) {
         txt=price[datas[4]]+" EUR";
	     var ttp= document.getElementById("ttp");
	     ttp.innerHTML = txt;
     }
	 var ttr= document.getElementById("ttr");
     ttr.setAttribute('x', Number(posx.nodeValue));
     ttr.setAttribute('y', Number(posy.nodeValue)-62);
     ttt.setAttribute('x', Number(posx.nodeValue)+5);
     ttt.setAttribute('y', Number(posy.nodeValue)-46);
     ttu.setAttribute('x', Number(posx.nodeValue)+5);
     ttu.setAttribute('y', Number(posy.nodeValue)-30);
     if ((typeof hideprice === 'undefined') || (hideprice == "0")) {
       ttp.setAttribute('x', Number(posx.nodeValue)+5);
       ttp.setAttribute('y', Number(posy.nodeValue)-14);
     }
     ttr.style.visibility = "visible";
     ttt.style.visibility = "visible";
     ttu.style.visibility = "visible";
     if ((typeof hideprice === 'undefined') || (hideprice == "0"))
       ttp.style.visibility = "visible";
}));

Array
  .from(pgseats)
  .forEach(element => element.addEventListener('mouseout', function(e) {

    var thisElement = e.currentTarget;
   thisElement.classList.remove('cur');
}));

Array
  .from(pgseats)
  .forEach(element => element.addEventListener('click', function(e) {

    var thisElement = e.currentTarget;
        var curdata = thisElement.getAttribute('orestes:data');
        var datas = curdata.split(',');
	thisElement.classList.remove('cur');
    var oldClassName = thisElement.classList.item(0);
    var isReserved = oldClassName.substring(0,3) == 'pgr';
        blockSeat(showId, thisElement.getAttribute('id').toString().substring(1), Number(datas[4])+1, pg[datas[4]], isReserved);

    if (isReserved)
      newClassName = oldClassName.substring(0,2)+oldClassName.substring(3);
    else
      newClassName = oldClassName.substring(0,2)+'r'+oldClassName.substring(2);
    thisElement.classList.remove( oldClassName);
    thisElement.classList.add( newClassName);
}));

/***********************************************/

/***********************************************/

function blockSeat(showId, ticId, pgId, pgName, isReserved) {

    var blockade = {
        "showId": showId,
        "blockNumber": 1,
        "unblockMode": isReserved ? 4 : 3,
        "tickets": [ticId],
        "ticketInfos": [{"pricegroupId": pgId,
        "pricegroupName" : pgName}]
    }

    xmlhttp = new XMLHttpRequest();
    if (xmlhttp) {
        xmlhttp.open("POST", "blockades", true); //blockades will be the endpoint on the webserver
        xmlhttp.onreadystatechange = handleServerResponse;
        xmlhttp.setRequestHeader("Content-Type", "application/json");
        xmlhttp.send(JSON.stringify(blockade));
    }
}

function handleServerResponse() {
   var id_format = "S";
   blockseat_error_code = 0;

   if (xmlhttp.readyState == 4) {
        if (xmlhttp.status == 200) {
	   var response  = JSON.parse(xmlhttp.responseText);
            if (-17 == response.errorId) {
	     window.alert("Der Platz wurde in der Zwischenzeit anderweitig reserviert.", 3000);
       }
     }
   }
}
